import React from 'react';
import {
  Button,
  Card,
  CardBody,
  CardFooter,
  CardTitle,
  Form,
  FormGroup,
  Input,
} from 'reactstrap';
import { Image } from 'react-bootstrap';
import './style.css';
import { Link } from 'react-router-dom';

const ComingSoon = () => {
  return (
      <div>
        <Card className="text-center" style={{width:'60rem', margin:'auto', marginTop:'5%'}}>
            <CardTitle>Apa</CardTitle>
            <CardBody>
                <Image src="./img/KIPLogo.svg"></Image>
            </CardBody>
        </Card>
      </div>
  )
};

export default ComingSoon;
